package io.github.hielkemaps.racecommand.skins;

import net.skinsrestorer.api.PlayerWrapper;
import net.skinsrestorer.api.SkinsRestorerAPI;
import net.skinsrestorer.api.exception.SkinRequestException;
import net.skinsrestorer.api.property.GenericProperty;
import net.skinsrestorer.api.property.IProperty;
import org.bukkit.entity.Player;

import java.util.HashMap;

public final class SkinManager {

    private static final HashMap<String, IProperty> storedSkins = new HashMap<>();

    public static void init(){
        SkinsRestorerAPI api = SkinsRestorerAPI.getApi();

        storedSkins.put("skeleton", api.createProperty("skeleton","", ""));

        storedSkins.put("villager1",api.createProperty("villager1","", ""));
        storedSkins.put("villager2", api.createProperty("villager2","",""));
        storedSkins.put("villager3", api.createProperty("villager3","",""));
        storedSkins.put("villager4", api.createProperty("villager4","",""));
        storedSkins.put("villager5", api.createProperty("villager5","",""));
        storedSkins.put("villager6", api.createProperty("villager6","",""));
        storedSkins.put("villager7", api.createProperty("villager7","",""));
        storedSkins.put("villager8", api.createProperty("villager8","",""));
        storedSkins.put("villager9", api.createProperty("villager9","",""));
        storedSkins.put("villager10", api.createProperty("villager10","",""));
        storedSkins.put("villager11", api.createProperty("villager11","",""));
        storedSkins.put("villager12", api.createProperty("villager12","",""));
        storedSkins.put("villager13", api.createProperty("villager13","",""));
        storedSkins.put("villager14", api.createProperty("villager14","",""));
        storedSkins.put("villager15", api.createProperty("villager15","",""));

        storedSkins.put("villager1zombie",api.createProperty("villager1zombie","", ""));
        storedSkins.put("villager2zombie",api.createProperty("villager2zombie","",""));
        storedSkins.put("villager3zombie", api.createProperty("villager3zombie","",""));
        storedSkins.put("villager4zombie", api.createProperty("villager4zombie","",""));
        storedSkins.put("villager5zombie", api.createProperty("villager5zombie","",""));
        storedSkins.put("villager6zombie", api.createProperty("villager6zombie","",""));
        storedSkins.put("villager7zombie", api.createProperty("villager7zombie","",""));
        storedSkins.put("villager8zombie", api.createProperty("villager8zombie","",""));
        storedSkins.put("villager9zombie", api.createProperty("villager9zombie","",""));
        storedSkins.put("villager10zombie", api.createProperty("villager10zombie","",""));
        storedSkins.put("villager11zombie", api.createProperty("villager11zombie","",""));
        storedSkins.put("villager12zombie", api.createProperty("villager12zombie","",""));
        storedSkins.put("villager13zombie", api.createProperty("villager13zombie","",""));
        storedSkins.put("villager14zombie", api.createProperty("villager14zombie","",""));
        storedSkins.put("villager15zombie", api.createProperty("villager15zombie","",""));
    }

    public static void changeSkin(Player player, String skin) {
        //player.sendMessage("changing skin to " + skin);
        //Bukkit.dispatchCommand(Bukkit.getConsoleSender(), "forward console skin set " + player.getName() + " " + skin);

        SkinsRestorerAPI api = SkinsRestorerAPI.getApi();
        PlayerWrapper wrapper = new PlayerWrapper(player);

        //if it's a skin we have stored (zombie/villagers)
        if(storedSkins.containsKey(skin)){
            IProperty property = storedSkins.get(skin);
            api.setSkinData(skin, new GenericProperty("textures", property.getValue(), property.getSignature()), null);
        }

        try {
            api.setSkin(player.getName(), skin);
            api.applySkin(wrapper, skin);
        } catch (SkinRequestException e) {
            e.printStackTrace();
        }
    }
}
